import { useState } from "react"
import { data } from "./liveData"
import "./commonStyle.css";
export default function TimeSpeed() {
    let [speedCounter,setSpeedCounter] = useState(1000);
    data.speedTimeCount= speedCounter;
    let handeleChange = (event) => {
        alert(event.target.value)
        setSpeedCounter(event.target.value);
    }
    return(
        <div className="timeCountButton">
            <select value={speedCounter} onChange={handeleChange}>
                <option value="2000">0.25x</option>
                <option value="1600">0.5x</option>
                <option value="1300">0.75x</option>
                <option defaultChecked value="1000">1x</option>
                <option value="700">1.25 x</option>
                <option value="400">1.5 x</option>
                <option value="100">1.75 x</option>
            </select>


        </div>
    )
}
